Mongoose model.save() error - 'Cannot apply $inc to a value of non-numeric type'<p>I have 2 mongoose models in their own respective files.</p>
<pre><code>const userSchema = new mongoose.Schema({
name:{type: String, required: true},
postHistory:[{type: mongoose.Schema.Types.ObjectId, ref: &quot;Posts&quot;}]
)};

module.exports = mongoose.model(&quot;User&quot;, userSchema );

const postSchema = new mongoose.Schema({
name:{type: String, required: true},
post:[{postName:String, postContent:String}]
)};

module.exports = mongoose.model(&quot;Posts&quot;, postSchema );
</code></pre>
<p>Now, I am trying to create a new post, save it and have the object id be reflected in the user schema.  For sake of simplicity, assume I have an async function where the model content is being passed as well as some sort of user id.</p>
<pre><code>const post = new Posts({name:'John', post:[{postName:'My Comment', postContent:'My Full comment'}]);
await post.save();      &lt;---This works as intended

const owner = await User.findById(userId);  &lt;--This retrieves the specific user post belongs to

owner.postHistory.push(post);   &lt;---Output now shows user with 1 post object within postHistory array

await owner.save();  &lt;-- Error occurs here
</code></pre>
<p>This is where the error occurs.  I get the following error:</p>
<pre><code>message&quot;: &quot;Cannot apply $inc to a value of non-numeric type. {_id: ObjectId('5e7908fd1e2e656d81a9ba05')} has the field '__v' of non-numeric type string&quot;
</code></pre>
<p>I believe I followed the right process as per the mongoose docs: <a href="https://mongoosejs.com/docs/populate.html#saving-refs" rel="nofollow noreferrer">Mongoose Model Ref</a></p>
<p>I dont get this error message when I already have an array of post ids already embedded within User.postHistory in MongoDB.  This only occurs when the User has an empty postHistory array (Think when the user has his first post associated with the user.</p>
<p>Any suggestions?</p>

