How can i format the date with Momentjs to look like this?<p>I used the following date format with a moment to save a date for a document in MongoDB. The problem is that it somehow got converted, I guess by MongoDB. Now if I want to fetch that data by specifying the date, I can't use the same variables I used to create the date in the first place. Can anyone tell me how I can do this?</p>
<pre><code>  const date = new Date();
  const firstDay = new Date(date.getFullYear(), date.getMonth(), 1);
  const startDate = moment(firstDay);
  const day = startDate;
</code></pre>
<p>the day variable is saved in MongoDB as</p>
<pre><code>'Wed Jun 24 2020 00:00:00 GMT+0300' 
</code></pre>
<p>But if I try to find the document by date, the day variable is actually returning</p>
<pre><code>2020-06-24T22:17:09+03:00
</code></pre>
<p>I guess what I am trying to do is return today's date in this format <code>'Wed Jun 24 2020 00:00:00 GMT+0300'</code> with time set to 0 as I only need the date to search for the document I need.</p>
<p><strong>EDIT: I was able to do it using Date instead of Momentjs.</strong></p>
<pre><code>  const date = new Date();
  date.setHours(0, 0, 0, 0);
  console.log(date.toString().split(&quot;(Eastern European Summer Time)&quot;)[0]);
  //Wed Jun 24 2020 00:00:00 GMT+0300
</code></pre>

