campaignController,
***Model,
***Routes,</p>
<p>and a handlerFactory to cover users and campaigns.</p>
<p>handlerFactory:</p>
<pre><code>exports.getAll = Model =&gt;
  catchAsync(async (req, res, next) =&gt; {
    // To allow for nested GET reviews on tour (hack)
    let filter = {};
    if (req.params.campaignId) filter = { campaign: req.params.campaignId };

    const features = new APIFeatures(Model.find(filter), req.query)
      .filter()
      .sort()
      .limitFields()
      .paginate();
    // const doc = await features.query.explain();
    const doc = await features.query;

    // SEND RESPONSE
    console.log('-------', doc);
    res.status(200).json({
      status: 'success',
      results: doc.length,
      data: {
        data: doc
      }
    });
  });
</code></pre>
<p>Campaign Model:</p>
<pre><code>const campaignSchema = new mongoose.Schema({
    name: {
        type: String,
        required: [true, 'Campaign name can not be empty!']
    },
    clientID: {
        type: String,
    },
    creator_id: {
        type: String,
    },
