MongoDB conditional lookup<p>I am trying to lookup a parent field by ID as part of an aggregation pipeline, but only certain fields have a parent.</p>
<p>so this code works fine when there is a parent, but breaks when there isn't:</p>
<pre><code>    //get parent info
    {
        '$lookup': {
            &quot;from&quot;: this.parentContentModel,
            &quot;localField&quot;: &quot;parent&quot;,
            &quot;foreignField&quot;: &quot;_id&quot;,
            &quot;as&quot;: &quot;parent&quot;
        }
    },
    {'$unwind': { path: '$parent' } },
</code></pre>
<p>According to <a href="https://stackoverflow.com/questions/38954687/how-to-apply-condition-on-lookup-result-in-mongodb">this</a> it's fine if the lookup doesn't exist (though it doesn't work if the field name is empty or null, so I put in a placeholder):</p>
<pre><code>    //get parent info
    {
        '$lookup': {
            &quot;from&quot;: this.parentContentModel  || 'noparent',
            &quot;localField&quot;: &quot;parent&quot;,
            &quot;foreignField&quot;: &quot;_id&quot;,
            &quot;as&quot;: &quot;parent&quot;
        }
    },
    {'$unwind': { path: '$parent' } },
</code></pre>
<p>Adding this doesn't fix it though, because then I need to unwind it, which breaks if the field doesn't exist. (If i take out the unwind, then it works fine when theres no parent, but then things with parents are broken because they need to be unwound).</p>
<p>According to <a href="https://stackoverflow.com/questions/30687607/what-will-happen-if-unwind-is-applied-to-a-field-which-is-not-present-while-usin">this</a> you can just project an empty array if the value was null, but $project drops all the old fields:</p>
<pre><code>{'$project': { parent: {'$ifNull': ['$parent', [ null ] ]}}},
</code></pre>
<p>So I tried using $addFields instead of $project, but it still broke things with no parent field:</p>
<pre><code>{'$addFields': { parent: {'$ifNull': ['$parent', [ null ] ]}}},
</code></pre>
<p>With that line added, it still only works for docs with a parent, unless I remove <code>$unwind</code>, which makes it only work for docs without a parent.</p>

